import React , { Fragment } from 'react';
import './App.css';

export default function App(): JSX.Element{

  const sum = (a:number, b:number):number => {
    return a+b;
  }

  return (
    <Fragment>
      <h1>Todo List</h1>
    </Fragment>
  );
}
